import React, { useState } from 'react';
import './login.scss'

export default function Login() {
    const [token, setToken] = useState();

    return (
        <div className="login-main-container">
            <form>
                <label>
                    <p>Username</p>
                    <input type="text" />
                </label>
                <label>
                    <p>Password</p>
                    <input type="password" />
                </label>
                <div>
                    <button type="submit">Submit</button>
                </div>
            </form>
        </div>
    )
}

Login.propTypes = {
    setToken: PropTypes.func.isRequired
  }
